import * as React from 'react';
import Button from '@mui/material/Button';



function App() {
  return (
    <div>
      <Button variant="contained">Hello World</Button>
      <Slider
        size="small"
        defaultValue={70}
        aria-label="Small"
        valueLabelDisplay="auto"
    />
    </div>
  );
}

export default App;
